        "stable_tour": [
          {
            "horse": "Finisk River",
            "horse_id": "2378946",
            "quote": "I don't think he really handled Cheltenham last week - he's an easy-moving horse and it was probably too up and down for him. He's not the best jumper of a hurdle and fell late on, but he's fine and fresh. He should have brought up his hat-trick at Bangor the time before and we'll probably go back to flat tracks. 09-11-20"
          },
          {
            "horse": "Finisk River",
            "horse_id": "2378946",
            "quote": "All yards need horses like Finisk River as he does so much to keep the winners flowing. His form this season has been fantastic with figures of 2121112. He completed a four-timer last autumn at Sedgefield and his rating has gone up from 107 to 128. However, that is still 7lb below the ridiculous rating of 135 he was given over two years ago after two novice hurdle wins at Cartmel. He is a grand horse, and although there are plenty of miles on his clock he has been a revelation this season. He is just coming to the end of his holiday and will be campaigned in similar fashion this spring-summer as he is just as enthusiastic as ever. 09-02-23"
          }
        ],
