        "quotes": [
          {
            "date": "2023-08-20",
            "horse": "Good Earth",
            "horse_id": "2697435",
            "race": "Sky Bet Sunday Series Sprint Handicap",
            "race_id": "845880",
            "course": "Sandown",
            "course_id": "crs_1404",
            "distance_f": "5",
            "distance_y": "1110",
            "quote": "Good Earth ran at Goodwood on unraceable ground in the Stewards' Cup and they called the meeting off after that and Yarmouth was on the dead side and today was more on the ground that he likes. We know he jumps the stalls well, but we weren't expecting him to jump that well. We half expected to take a lead of Tom Marquand's horse (Get It) and sit maybe fifth or sixth and come with a run and see how far we have got. I've put him in the Ayr Gold Cup, but it depends on the ground and if it soft that would be a bit stiff. There is a race at York on Saturday but that might come too soon. The Portland would be a race for him and he only just missed getting in last year, but that would be a race for him - Michael Herrington, trainer."
          },
          {
            "date": "2023-07-14",
            "horse": "Good Earth",
            "horse_id": "2697435",
            "race": "cavani.co.uk The Sartorial Sprint Handicap",
            "race_id": "843231",
            "course": "Newmarket (July)",
            "course_id": "crs_4524",
            "distance_f": "5",
            "distance_y": "1100",
            "quote": "Good Earth loves a stiff five furlongs as he has won at Beverley and run well at Sandown. I think a stiff five probably suits him better than an easy six as he can sometimes over race a bit early. The top horses probably came out of the race which made it a little bit easier for us, but he has done it well. We've got some good races to go to war at.  There is the Sunday Series, and he has won one of them already so we might get greedy and go for another one of them. I've put him in the Stewards' Cup, but that is an easy six with a stiff finish. I'm in the Racing League as well in the Yorkshire team with Leonna Mayor and hopefully she might put me in one of them races as they are worth a good bit - Michael Herrington, trainer."
          }
        ],
