        "quotes": [
          {
            "date": "2024-06-26",
            "horse": "Orbaan",
            "horse_id": "1371584",
            "race": "Stablemate By AGMA Carlisle Bell Handicap",
            "race_id": "869346",
            "course": "Carlisle",
            "course_id": "crs_208",
            "distance_f": "8",
            "distance_y": "1713",
            "quote": "Orbaan is nine years old now and dropping in class, and deserves to win a race like this - Danny Tudhope, jockey."
          },
          {
            "date": "2022-08-06",
            "horse": "Orbaan",
            "horse_id": "1371584",
            "race": "Dubai Duty Free Full Of Surprises Classified Stakes (GBB Race)",
            "race_id": "816800",
            "course": "Ascot",
            "course_id": "crs_52",
            "distance_f": "7",
            "distance_y": "1540",
            "quote": "I checked with the track and they said they put a lot of water on and that the ground wasn't too fast. It was perfect for Orbaan and I wouldn't risk him on quick ground. He's better on softer ground and could go to York for the Ebor meeting - Jimmy Chua, owner."
          },
          {
            "date": "2022-07-29",
            "horse": "Orbaan",
            "horse_id": "1371584",
            "race": "Coral Golden Mile Handicap",
            "race_id": "813938",
            "course": "Goodwood",
            "course_id": "crs_546",
            "distance_f": "8",
            "distance_y": "1760",
            "quote": "It's been a long time since Orbaan last won. The last time he won he did it like a Group horse in a handicap and hasn't won since. He's dropped down a bit but he got a good run through and the longer this horse travels, the better. He got the draw and it was the type of race that would suit him - David O'Meara, trainer."
          }
        ],
        "stable_tour": [
          {
            "horse": "Orbaan",
            "horse_id": "1371584",
            "quote": "He was a revelation last year, winning the Golden Mile at Goodwood and at the Shergar Cup. He really seemed to enjoy his racing again. He ran over the sharp seven at Haydock last weekend, but the Victoria Cup will suit him better. His season will be built around the heritage handicaps, particularly Goodwood. 04-05-23"
          }
        ],
