        "quotes": [
          {
            "date": "2023-08-25",
            "horse": "Marhaba The Champ",
            "horse_id": "3816928",
            "race": "Sky Bet Handicap (Heritage Handicap)",
            "race_id": "845928",
            "course": "York",
            "course_id": "crs_2782",
            "distance_f": "12",
            "distance_y": "2608",
            "quote": "Ryan [Moore] said he just jumped a little bit awkwardly and that they didn't go as quickly as they might have. Marhaba The Champ was running a little bit free with him but he relaxed and let him fill up. He's done it well and that was a class ride. He'll probably get further but needs to relax a bit more. That's an avenue for the future but we'll probably stick to this trip for now - Kevin Ryan, trainer."
          },
          {
            "date": "2023-05-19",
            "horse": "Marhaba The Champ",
            "horse_id": "3816928",
            "race": "Knights Solicitors Handicap",
            "race_id": "838276",
            "course": "York",
            "course_id": "crs_2782",
            "distance_f": "10.5",
            "distance_y": "2256",
            "quote": "We thought Marhaba The Champ would run a big race and William (Buick) gave him a fantastic ride. He's a horse we like a lot, we've just been waiting for the ground. He loves quick ground without any juice in it at all - it's so important to him. I could see him going a bit further in time - Kevin Ryan, trainer."
          }
        ],
