        "quotes": [
          {
            "date": "2024-09-19",
            "horse": "Hornsea Bay",
            "horse_id": "6451095",
            "race": "Western House Hotel EBF Novice Stakes (GBB Race)",
            "race_id": "874905",
            "course": "Ayr",
            "course_id": "crs_78",
            "distance_f": "8",
            "distance_y": "1760",
            "quote": "Hornsea Bay looked impressive. His home work had been pretty good. If you debut them over a mile at this time of year you like to think they'll stay ten furlongs and maybe a mile and a half. We might run him in another novice for experience. He could be nice next year, he's got a good pedigree as well - David O'Meara, trainer."
          }
        ],
        "stable_tour": [
          {
            "horse": "Hornsea Bay",
            "horse_id": "6451095",
            "quote": "He's very exciting - so much so I've entered him in the Dante. He was very good last year when he won and then he wasn't beaten far giving away a penalty. He got a bit hot before his comeback run at Nottingham on Saturday in a strong race. He ran fine and was maybe a bit fresh for his first run. We'll look at a nice mile handicap and I'm sure he can step up in trip as the season goes on. 14-04-25"
          },
          {
            "horse": "Hornsea Bay",
            "horse_id": "6451095",
            "quote": "We bought him at the Arqana Breeze-Up Sale in May. He has a really classy Cheveley Park pedigree by a quality stallion out of a Listed-class mare. He's a good-looking horse with lots of size and scope and we're really excited by him. He'd been working nicely going into his debut at Ayr last week but he delivered more than expected by winning easily. We'll probably look to give him one more run from mid-October and there are a few options for him, including the Silver Tankard at Pontefract. He's bred to be a three-year-old over middle distances and gives every indication that's exactly what he'll be. He shows a lot of promise and he's one to really look forward to next year. 26-09-24"
          }
        ],
