            "course": "Ayr",
            "course_id": "crs_78",
            "distance_f": "6",
            "distance_y": "1320",
            "quote": "Roundhay Park was very relaxed today. He sometimes gets wound up but he came up yesterday and he's been very relaxed. He was given a great ride by Faye as there was no panic and no rush - Nigel Tinkler, trainer."
