        "stable_tour": [
          {
            "horse": "Roundhay Park",
            "horse_id": "1503432",
            "quote": "He's a lovely horse and has been a great servant for the yard. He was second in the Shergar Cup Sprint Cup years back under Hayley Turner and was a top-class handicapper in his heyday. He finished last of 11 at York on Friday and hasn't shown it in his last two starts but the handicapper has just got him high enough. He's a little bit older now and we could do with a bit of help from the handicapper. 27-07-22"
          }
        ],
