        "medical": [],
        "quotes": [
          {
            "date": "2023-05-20",
            "horse": "Bear Force One",
            "horse_id": "2701446",
            "race": "BetVictor Handicap",
            "race_id": "838323",
            "course": "Newbury",
            "course_id": "crs_936",
            "distance_f": "8",
            "distance_y": "1760",
            "quote": "When everything goes right for Bear Force One he's a proper horse and he loves this track. It suits his style as he's a massive horse - a big galloper who can keep his stride pattern going here. He likes a bit of life in the ground and I was worried with the rain yesterday. We were talking of putting him away after this because he doesn't handle the hot weather. We'll see how he is. The plan is the London Mile final in September, but he'll run before then - Roger Teal, trainer."
          },
          {
            "date": "2023-04-01",
            "horse": "Bear Force One",
            "horse_id": "2701446",
            "race": "Try Unibet's Improved Bet Builder Handicap (London Mile Series Qualifier)",
            "race_id": "834766",
            "course": "Kempton (AW)",
            "course_id": "crs_28054",
            "distance_f": "8",
            "distance_y": "1760",
            "quote": "There is a 0-105 back here later this month or there is the Spring Cup at Newbury. Timing wise that's perfect for Bear Force One. I'd say we'll probably go to Newbury and hopefully we can go there confident on the back of a good run - Roger Teal, trainer."
          },
          {
            "date": "2020-07-09",
            "horse": "Bear Force One",
            "horse_id": "2701446",
            "race": "Each Way Extra At bet365 Handicap",
            "race_id": "760277",
            "course": "Newmarket (July)",
            "course_id": "crs_4524",
            "distance_f": "8",
            "distance_y": "1760",
            "quote": "When Bear Force One ran the last day at Newbury he was just wandering away from the other horses and James Doyle suggested we put some headgear on. He was progressive last season and the way he has run the last twice he has looked like he needed the mile but it might have just stretched him - Roger Teal, trainer."
          },
          {
            "date": "2019-09-21",
            "horse": "Bear Force One",
            "horse_id": "2701446",
            "race": "Heatherwold Stud Handicap",
            "race_id": "738040",
            "course": "Newbury",
            "course_id": "crs_936",
            "distance_f": "7",
            "distance_y": "1540",
            "quote": "Bear Force One is a big, raw baby and he's improved with every run. I thought he was given a stiff mark, but the handicapper knew differently and he's a lovely, big horse. I think we'll take things slowly as next year is his year. He doesn't stop surprising me and is quite a lazy work horse at home - Roger Teal, trainer."
          }
        ],
        "stable_tour": [
          {
            "horse": "Bear Force One",
            "horse_id": "2701446",
            "quote": "He won so well last time at Newbury ? a career-best ? so we might as well have a crack at the Royal Hunt Cup. He's not a forlorn hope if he gets in and everything is in his favour. He could be a live outsider and you can forget his run at Ascot two races ago when he lost a shoe and then lost his action; Billy Loughnane said he was cantering before that. 13-06-23"
          }
        ],
