        "quotes": [
          {
            "date": "2024-06-17",
            "horse": "Stockpyle",
            "horse_id": "3960811",
            "race": "Plan A Consulting Handicap (Chepstow Mile Series Qualifier)",
            "race_id": "869149",
            "course": "Chepstow",
            "course_id": "crs_312",
            "distance_f": "8",
            "distance_y": "1774",
            "quote": "We were going to sell Stockpyle at the July sales, but PJ [McDonald, jockey] said something was troubling him. We took him to the vets and checked him, where we found a huge growth under his epiglottis. It was like having a cork in a bottle and he couldn't breathe, but now his confidence is being rewarded. He's been running some lovely races and has been unlucky not to win more. He's from a very good family and there's more excitement to come - William Muir, joint-trainer."
          }
        ],
        "stable_tour": [
          {
            "horse": "Stockpyle",
            "horse_id": "3960811",
            "quote": "Another of La Pyle's progeny who is a half-brother to Pyledriver, he did his owners proud this summer by winning twice in four days at Chepstow and Wolverhampton, both over 7f. I love him and having had a tiny injury as a juvenile - a split pastern that healed beautifully - he has made steady progress. He was last of six at Chepstow on Monday but must have the ground just right and when things go his way he looks pretty impressive. Clearly 7f is his trip and there are more wins to come this year. 01-09-22"
          }
        ],
