            "quote": "He's been a star for us. We were very lucky to be sent him by Mr Jones, who also has Bensini with us and is one of my biggest supporters. He's a true gentleman who has supported us from the start. He's what you dream of for a racehorse - he eats every nut, he runs away with the lads every day. He loves being a racehorse. He's progressed and I didn't expect him to be winning off the marks he's been running off [122 currently]. I always thought he'd be a 110-rated horse max, but because he travels and jumps so well he's a great horse to have. When the race is right he'll win again. He's so consistent and we all love him. In his grade he's hard to beat. He's having a break at the moment but he'll be back out in the spring and go through the summer. 01-02-24"
