            "quote": "We didn't know much about Darvel so that's why we ran him relatively quickly. He was rather disappointing us a bit on the all-weather, but he hadn't ran for a long time and probably needed it. We haven't had many runners, they haven't ran during the winter, we had a good second at Ascot and they're coming good now - Patrick Chamings, trainer."
