        "stable_tour": [
          {
            "horse": "Cash",
            "horse_id": "3848296",
            "quote": "I was delighted with his run at Windsor in a Listed race last time out. I know he was beaten six lengths, but he's been plagued with injuries at the wrong time. He got another fracture, of his humerus this time, in the spring and it was a little bit of a rush back. I don't think he stays a mile and a half but what he did for nine-tenths of that race was very good. I think if we'd have run him over shorter than that distance he'd have been off the bridle earlier, whereas he only got tired very late on at Windsor. It'll have served a very good purpose. He hasn't done a lot wrong and he enjoys a bit of juice in the ground. He's got a QEII entry but whether we go there will depend on his next run - I'd imagine that will be in two to three weeks. I think he retains all his old ability. We'll drop him back to ten furlongs or a mile. 04-09-24"
          }
        ],
