        "quotes": [
          {
            "date": "2023-07-07",
            "horse": "Savvy Victory",
            "horse_id": "3772693",
            "race": "Davies Insurance Solutions Gala Stakes (Listed Race)",
            "race_id": "843112",
            "course": "Sandown",
            "course_id": "crs_1404",
            "distance_f": "10",
            "distance_y": "2189",
            "quote": "We were absolutely gutted in the Wolferton. Savvy Victory got knocked over at a crucial time. We had an option of coming here or going for the John Smith's Cup and we chose to come here. We got away with it to be honest as that ground is drying out all the time. We took our time, and came there, and he has quickened on ground he doesn't really like as he would like it heavier. A mile and a quarter is his trip. You haven't seen anything yet. On heavy ground, he will be a proper horse - Sean Woods, trainer."
          },
          {
            "date": "2022-08-28",
            "horse": "Savvy Victory",
            "horse_id": "3772693",
            "race": "William Hill Handicap",
            "race_id": "817866",
            "course": "Goodwood",
            "course_id": "crs_546",
            "distance_f": "10",
            "distance_y": "2177",
            "quote": "Things probably didn't go Savvy Victory's way last time, but he's done things the right way today and got a nice lead into the race. I might have got there too soon, but he's a lovely, progressive type - I'm sure he'll improve again from today. I was surprised how well he made up ground quickly and I suppose he could try a mile and a half again, although he'd have options at a mile and a quarter. I don't see why he couldn't step back into Listed company, although his best form is probably with cut in the ground. He's a heavy horse, but he might progress with regard to better ground with age - David Probert, rider."
          }
        ],
