            "distance_f": "10.5",
            "distance_y": "2350",
            "quote": "It's great to get Picpoul back on track, hopefully she'll now go on from this, next week there is another one for her. During the summer she had physio for a back problem but we have her back and I'm delighted with that. We wanted to try hurdling but she won't jump a pole! - Michael Rice, trainer, talking to Racing TV"
