            "course_id": "crs_4862",
            "distance_f": "20",
            "distance_y": "4400",
            "quote": "I'd say it's important for Al Gasparo to be fresh. He's good when he gets into that rhythm and gets it easy on his own. It was a good performance. It's in the lap of the handicapper now, but he's a lad who will jump a fence - Gavin Cromwell, trainer."
