        "quotes": [
          {
            "date": "2022-06-26",
            "horse": "HMS Seahorse",
            "horse_id": "3125342",
            "race": "Irish Stallion Farms EBF \"Ragusa\" Handicap (Premier Handicap)",
            "race_id": "815651",
            "course": "Curragh",
            "course_id": "crs_4628",
            "distance_f": "12",
            "distance_y": "2640",
            "quote": "HMS Seahorse is a right little horse. He was bought for us by Gerry Hogan. He handled the ground well and they can finish spread out like that. He might go for the Galway Hurdle now - James Nolan, assistant trainer."
          }
        ],
        "stable_tour": [
          {
            "horse": "HMS Seahorse",
            "horse_id": "3125342",
            "quote": "He is an uncomplicated little fellow. He ran very well on his comeback over hurdles when winning at Navan and certainly looks like he is better after being gelded. He will hopefully come on for that run and he has travelled over to Cheltenham before and ran well so we are looking forward to him. He ran very well in the Boodles last year and wasn't beaten far in fourth, and that race has worked out very well with regards to the horses in front of him. He got an extra 4lb on top of his Irish mark which we could have done without, but it is what it is. He is only small but his heart is in the right place so hopefully he will give his owners a good run and day out. 25-02-23"
          }
        ],
