        "quotes": [
          {
            "date": "2024-10-05",
            "horse": "Visionarian",
            "horse_id": "2860801",
            "race": "PWC Champion Chase (Grade 2)",
            "race_id": "878404",
            "course": "Gowran Park",
            "course_id": "crs_4784",
            "distance_f": "20",
            "distance_y": "4400",
            "quote": "Things certainly hadn't gone to plan since we got Visionarian as he wasn't right. That said, I was confident enough he'd run well but didn't expect him to win. I know the race ended up with only three runners, but we'll take it and he is now a Grade 2 winner. The Galway Plate was initially the plan, but he just wasn't right at that time and then was well beaten the last day, but he is back on track now - Gavin Cromwell, trainer."
          },
          {
            "date": "2023-09-17",
            "horse": "Visionarian",
            "horse_id": "2860801",
            "race": "Kerry Group Chase",
            "race_id": "849461",
            "course": "Listowel",
            "course_id": "crs_4940",
            "distance_f": "20",
            "distance_y": "4400",
            "quote": "Visionarian was sticking at it well and was getting the trip well. It's great to win a race like this with him, though it's a pity to win it that way. The last thing we really wanted was for Paul to go out in front and be able to fill his fellow up with us sitting behind him; the plan was to try to force it from three or four out. This trip is probably as far as he wants at the moment - Peter Fahey, trainer"
          },
          {
            "date": "2022-07-28",
            "horse": "Visionarian",
            "horse_id": "2860801",
            "race": "Guinness Open Gate Brewery Novice Chase (Grade 3)",
            "race_id": "818067",
            "course": "Galway",
            "course_id": "crs_4758",
            "distance_f": "18.5",
            "distance_y": "4014",
            "quote": "It was very competitive and a lot of them had high marks over hurdles but we always thought our lad would be better over a fence and he's starting to prove that - Peter Fahey, trainer of Visionarian"
          },
          {
            "date": "2021-06-18",
            "horse": "Visionarian",
            "horse_id": "2860801",
            "race": "Island Garden Rooms Handicap Hurdle",
            "race_id": "787626",
            "course": "Down Royal",
            "course_id": "crs_4680",
            "distance_f": "20.5",
            "distance_y": "4480",
            "quote": "Visionarian is a strong traveller. Stepping him up in trip was a big help to him. We'll put him away now for Galway. The staying handicap hurdle towards the end of the week could suit him well. He's a nice horse going forward and I can't wait to get him over fences. He likes that good ground, too, which is a help. We done his wind since he ran last so that might have helped as well - Peter Fahey, trainer."
          },
          {
            "date": "2020-10-02",
            "horse": "Visionarian",
            "horse_id": "2860801",
            "race": "Join Racing TV Now Maiden Hurdle (Div II)",
            "race_id": "768476",
            "course": "Gowran Park",
            "course_id": "crs_4784",
            "distance_f": "16",
            "distance_y": "3520",
            "quote": "He done that easily and hurdled very well. The ground was lively enough for him. I was always confident I'd get there. He won like a nice horse - Denis O'Regan, rider"
          }
        ],
        "stable_tour": [
          {
            "horse": "Visionarian",
            "horse_id": "2860801",
            "quote": "He'll go for the Grade 1 at Leopardstown over two miles and a furlong. Obviously, on ratings he's going to be a little bit behind but hopefully he'd have a place chance. 21-12-24"
          },
          {
            "horse": "Visionarian",
            "horse_id": "2860801",
            "quote": "We were delighted with his Grade 2 win at Gowran last month and I was happy with his run at Down Royal last time as I thought he ran well in fourth. Three miles might have stretched him a little bit. When the ground gets softer, we might have to pull up stumps with him and bring him back in the spring, but we won't rule out anything for the moment. 13-11-24"
          }
        ],
