        "quotes": [
          {
            "date": "2023-10-27",
            "horse": "Encanto Bruno",
            "horse_id": "4201359",
            "race": "Trustatrader Novices' Hurdle (GBB Race)",
            "race_id": "850710",
            "course": "Cheltenham",
            "course_id": "crs_286",
            "distance_f": "20",
            "distance_y": "4380",
            "quote": "Encanto Bruno was keen quite early and jumped a few big but travelled very strongly. He surprised me to be honest, although he goes well at home he's a far better racehorse than he is work horse. He's versatile, he could come back to two (miles) and he's a lovely horse to look forward to and he'll be exciting when he jumps a fence - Gavin Cromwell, trainer."
          },
          {
            "date": "2023-07-08",
            "horse": "Encanto Bruno",
            "horse_id": "4201359",
            "race": "Bar One Racing Price Boosts All Channels Maiden Hurdle",
            "race_id": "844858",
            "course": "Bellewstown",
            "course_id": "crs_4576",
            "distance_f": "17",
            "distance_y": "3708",
            "quote": "The plan is Cheltenham later on this year and I think Encanto Bruno will stay well - John McConnell, trainer."
          },
          {
            "date": "2022-10-22",
            "horse": "Encanto Bruno",
            "horse_id": "4201359",
            "race": "Spirax-Sarco Engineering Sustainability Open National Hunt Flat Race (Category 1 Elimination) (GBB)",
            "race_id": "821523",
            "course": "Cheltenham",
            "course_id": "crs_286",
            "distance_f": "16.5",
            "distance_y": "3607",
            "quote": "This is an important one as we thought Encanto Bruno was very good. He's done everything right at home along the way and the race wouldn't have been run to suit with a slow pace all the way. He's a baby and he was spooking at the screen going out and coming back in but he looks a proper horse. He's only a 4yo so I'd say we'll probably leave him in bumpers because there's a whole life ahead of him. He hasn't had much of a break since we've got him so we'll probably give him a holiday now and come back in the spring for a nice race. He's going to be a nice jumper in time - John McConnell, trainer."
          }
        ],
        "stable_tour": [
          {
            "horse": "Encanto Bruno",
            "horse_id": "4201359",
            "quote": "He won a novice hurdle nicely at Cheltenham last month. He travelled strongly over two and a half miles there, nearly a bit too strong, and overjumped a few. He looks versatile as he could definitely come back in trip. I'm not sure he's as ground-dependent as people think, so we might try him on soft ground and see how he gets on - I wouldn't rule out going for the Royal Bond as I think he can make his mark in Graded races. He jumps very well and is one to look forward to when we send him over fences. 10-11-23"
          },
          {
            "horse": "Encanto Bruno",
            "horse_id": "4201359",
            "quote": "We got him after he won his point-to-point at Ballynoe 12 months ago and he has done himself proud. We took him to Cork for his first run in a bumper and he won that, but he was even more impressive when a good four-length winner at Cheltenham in November. We sent him back for the festival but the soft ground blunted his speed. He's a possibility for Aintree or Punchestown and then we may go hurdling in the summer with him. He jumps well and looks a nice hurdling prospect. 06-04-23"
          }
        ],
