        "comment": "",
        "spotlight": "",
        "medical": [],
        "quotes": [
          {
            "date": "2025-05-30",
            "horse": "Clarens",
            "horse_id": "3445037",
            "race": "Vince Power Memorial Handicap Chase",
            "race_id": "896716",
            "course": "Tramore",
            "course_id": "crs_5200",
            "distance_f": "15.5",
            "distance_y": "3410",
            "quote": "He jumped savage and Clarens actually put a couple of them on the deck that tried to go with him. You couldn't fault him, he is as honest. He had top weight and he is not that big of a horse. He won three on the bounce when he started handicapping over hurdles and then he had a few little problems but thankfully now since he has gone jumping fences he has been a revelation again. It's just fantastic to have a lad like him. There is a race at Cartmel at the end of June and he could go for that - John Flavin, trainer."
          },
          {
            "date": "2024-11-16",
            "horse": "Clarens",
            "horse_id": "3445037",
            "race": "Hotel Park St. Johann In Tirol Austria Handicap Hurdle",
            "race_id": "881936",
            "course": "Navan",
            "course_id": "crs_5018",
            "distance_f": "16",
            "distance_y": "3570",
            "quote": "Clarens was second last year and it was in my mind to come back here. He was well in with Alex Harvey's claim and we got there in time. He loves it here and we might look for something else here - John Flavin, trainer."
          },
          {
            "date": "2021-11-21",
            "horse": "Clarens",
            "horse_id": "3445037",
            "race": "Navan Handicap Hurdle",
            "race_id": "798787",
            "course": "Navan",
            "course_id": "crs_5018",
            "distance_f": "16",
            "distance_y": "3520",
            "quote": "I would say Clarens learnt more today than ever before because he was shuffled back further than we wanted, and to be fair to Jack [Foley], he sat with him and had to come wide. Thankfully he jumped the last well and stayed going. It was lovely. He's improving all the time. Today was the plan, but there is a novice handicap in Leopardstown on St Stephen's Day and we might go there - John Flavin, trainer."
          },
          {
            "date": "2021-09-20",
            "horse": "Clarens",
            "horse_id": "3445037",
            "race": "Adare Manor Opportunity Handicap Hurdle (Div II)",
            "race_id": "794059",
            "course": "Listowel",
            "course_id": "crs_4940",
            "distance_f": "16",
            "distance_y": "3520",
            "quote": "Clarens is a lovely little horse that has taken time to come to himself. I told Jack to ride him good and positive and he jumped very well. I was hopeful of a good run - John Flavin, trainer."
          }
        ],
