            "distance_f": "16.5",
            "distance_y": "3640",
            "quote": "It was a great ride. Brian [Hayes] went down the rail and I think that made the difference between first and second. May Call You Back travelled a lot more kindly than she did the last day at Tramore, and I'd say fences improve her as she jumps so well. Hopefully she can win another hurdle or chase. She's in on Friday in Wexford over fences again and if she gets in, she'll probably run again there - Patrick Mullins, trainer's assistant."
