            "quote": "Definiteadare was just a bit unlucky at Clonmel when he stumbled at the back of the second last and pulled a shoe. He probably would have been up in another 20 yards. We had a few quid on the last day but we left him roll away today. He's going the right way, is tough and stays over the trip. He had point-to-point experience but horses nearly always take a run in a handicap - Tom Cooper, trainer."
